import "../css/Game.css";
import TetrisHeader from "./TetrisHeader";


const Game = () => {
    return(
        <div className="Game">
            <TetrisHeader />
            <div className="Tetris-home">
                <div className="help">
                    <h1>HELP</h1>
                    {/* left */}
                    <div className="left">
                        <img src={left_arrow} alt="left arrow img" className="left-arrow" />
                    </div>
                </div>
                <div>SINGLE</div>
            </div>
        </div>
    )
}
export default Game;
